export {};

export class Node {
  row = 0;
  column = 0;
  value = 0;

  isStart = false;
  isFinish = false;

  Neighbors = new Array<Node>();

  constructor(
    row: number,
    column: number,
    isStart: boolean,
    isFinish: boolean
  ) {
    this.row = row;
    this.column = column;
    this.isStart = isStart;
    this.isFinish = isFinish;
  }
}
